import React from 'react';
import './App.css';
import Homepage from '../src/pages/homepage/homepage.component';
import {Browser, Routes } from 'react-router-dom';


const HatsPage = () => (
  <div>
    <h1> HATS PAGE</h1>
  </div>
);


function App() {
  return (
    <div>  
      {/* <Homepage /> */}
      <Routes>
        <Route exact path='/' element={<Homepage/>} />
        <Route path='/hats' element={<HatsPage />} />
      </Routes>


    </div>
  );
}

export default App;
